import React from 'react';

function Home() {
  const downloadResume = () => {
    fetch('http://localhost:5000/download-resume')
      .then(res => {
        if (!res.ok) throw new Error('Network response was not ok');
        return res.blob();
      })
      .then(blob => {
        const url = window.URL.createObjectURL(blob);
        const a = document.createElement('a');
        a.href = url;
        a.download = 'resume.pdf';
        document.body.appendChild(a);
        a.click();
        a.remove();
        window.URL.revokeObjectURL(url);
      })
      .catch(err => {
        alert('Download failed: ' + err.message);
      });
  };

  return (
    <div className="page-content">
      <h1>Welcome to My Profile</h1>
      <p>Hello! I'm a passionate developer eager to showcase my projects and skills.</p>

      <button onClick={downloadResume}>Download Resume PDF</button>

      {/* Education Section */}
      <section className="education-section">
        <h2>Education</h2>
        <div className="education-list">
          <div className="education-item">
            <h3>Malnad College of Engineering, Hassan-573 202</h3>
            <p>8.39 CGPA (Pursuing, 2026)</p>
          </div>
          <div className="education-item">
            <h3>Sri Sangameshwar PU College, Chadachan-586205</h3>
            <p>95.83% (2022)</p>
          </div>
          <div className="education-item">
            <h3>Sri Sangameshwar Madhyamika Shala, Chadachan-586205</h3>
            <p>91.04% (2020)</p>
          </div>
        </div>
      </section>
    </div>
  );
}

export default Home;
